/**
 *
 * @param image
 * @return an integer between 0 and 35 containing the prediction
 */


int DeepNeuralNetwork::inference(const int image[][INPUT_IMAGE_SIZE]) {
    float input[INPUT_IMAGE_SIZE][INPUT_IMAGE_SIZE];

    for (int i = 0; i < INPUT_IMAGE_SIZE; i++)
        for (int j = 0; j < INPUT_IMAGE_SIZE; j++)
            input[i][j] = image[i][j];

    conv2d(input, conv2D_filter, conv2d_output);
    maxpool2d(conv2d_output, maxpool_output);
    flatten(maxpool_output, flatten_output);
    dense(flatten_output, dense_output);

    float max = dense_output[0];
    int maxIndex = 0;
    for (int i = 0; i < DENSE_OUTPUT_SIZE; i++) {
        if (dense_output[i] > max) {
            max = dense_output[i];
            maxIndex = i;
        }
    }

    for (int i = 0; i < DENSE_OUTPUT_SIZE; i++) {
        //  std::cout << "Neuron " << i << ": " << dense_output[i] << std::endl;
    }
    char prediction;
    if (maxIndex < 10)
        prediction = maxIndex + '0';
    else
        prediction = maxIndex - 10 + 'A';
    //std::cout << "Inference neuron: " << maxIndex << std::endl;
    //std::cout << "Inference letter: " << prediction << std::endl;
    //std::cout << std::endl;
    return maxIndex;
}

void DeepNeuralNetwork::conv2d(const float input[][CONV2D_INPUT_SIZE], const float kernel[][CONV2D_SIZE],
                               float output[][CONV2D_OUTPUT_SIZE]) {
    for (int i = 0; i < CONV2D_OUTPUT_SIZE; i++) {
        for (int j = 0; j < CONV2D_OUTPUT_SIZE; j++) {
            float res = 0;
            for (int k = 0; k < CONV2D_SIZE; k++) {
                for (int m = 0; m < CONV2D_SIZE; m++) {
                    int row = i + k;
                    int col = j + m;
                    float mul = input[row][col] * kernel[k][m];
                    res = res + mul;
                }
            }
            output[i][j] = leaky_relu(res);
        }
    }
}

void DeepNeuralNetwork::maxpool2d(const float input[][MAX_POOL_INPUT_SIZE], float output[][MAX_POOL_OUTPUT_SIZE]) {
    for (int i = 0; i < MAX_POOL_OUTPUT_SIZE; i++)
        for (int j = 0; j < MAX_POOL_OUTPUT_SIZE; j++)
            output[i][j] = 0;

    for (int y = 0; y < MAX_POOL_OUTPUT_SIZE; ++y) {
        for (int x = 0; x < MAX_POOL_OUTPUT_SIZE; ++x) {
            for (int i = 0; i < MAX_POOL_SIZE; ++i) {
                for (int j = 0; j < MAX_POOL_SIZE; ++j) {
                    float value = input[y * MAX_POOL_SIZE + i][x * MAX_POOL_SIZE + j];
                    output[y][x] = std::max(output[y][x], value);
                }
            }
        }
    }
}

void DeepNeuralNetwork::flatten(const float input[][FLATTEN_INPUT_SIZE], float *output) {
    for (int i = 0; i < FLATTEN_INPUT_SIZE; i++)
        for (int j = 0; j < FLATTEN_INPUT_SIZE; j++)
            output[i * FLATTEN_INPUT_SIZE + j] = input[i][j];
}

void DeepNeuralNetwork::dense(const float *input, float *output) {
    for (int i = 0; i < DENSE_OUTPUT_SIZE; i++)
        output[i] = 0;

    for (int i = 0; i < DENSE_INPUT_SIZE; i++)
        for (int j = 0; j < DENSE_OUTPUT_SIZE; j++)
            output[j] += dense_weights[i * DENSE_OUTPUT_SIZE + j] * input[i];
}

float DeepNeuralNetwork::leaky_relu(float x) {
    if (x >= 0)
        return x;
    return 0.01 * x;
}

char DeepNeuralNetwork::label_to_char(int label) {
    if (label < 10)
        return label + '0';
    return label - 10 + 'A';
}
